        cartBindings: function cartBindings() {
            var self = this;

            $(document).on('click', '.remove-from-cart', function () {
                var $this = this;
                var id = $($this).data('productid');
                var storeId = $($this).data('storeid');
                var isSupplier = $($this).data('supplier');
                ok.notify.confirm('آیا مایل به حذف کالای فوق از سبد خرید هستید؟', function () {
                    self.removeFromCartAjax($this, id, storeId, isSupplier);
                }, function () {
                }, {
                    labels: {
                        Ok: "بله",
                        Cancel: "خیر"
                    }
                });
            });

            $(document).on('change', '.cart-qty-select', function () {
                var id = $(this).data('productid');
                var storeId = $(this).data('storeid');
                var isSupplier = $(this).data('supplier');
                var qty = $(this).val();
                self.updateCartItemtAjax(this, {productId: id, storeId: storeId, isSupplier: isSupplier, qty: qty});
            });

            $(document).on('click', '.add-to-cart', function (event) {
                event.preventDefault();
                var id = $(this).data('productid');
                var storeId = $(this).data('storeid');
                var isSupplier = $(this).data('supplier');
                var qty = parseFloat($(this).data('qty'));

                var hasLocation = localStorage.getItem('hasLocation');
                if (typeof hasLocation !== 'undefined' && hasLocation !== null && hasLocation.length > 0 && hasLocation === '1') {
                    if (qty === undefined || qty === null || qty < 1) {
                        self.removeFromCartAjax(this, id, storeId, isSupplier);
                        return false;
                    }

                    self.addToCartAjax(this, {
                        productId: id,
                        storeId: storeId,
                        isSupplier: isSupplier,
                        qty: qty
                    }, $(this)[0].innerHTML);
                } else {
                    $(this).attr('data-qty', qty);
                    localStorage.setItem('add-to-cart', ".add-to-cart[data-productid=\"" + id + "\"][data-qty=\"" + qty + "\"]");
                    $('[data-click=showLocation]').trigger('click');
                }
            });
        },

